import React, { Component } from 'react';

class Register extends Component{
    constructor(){
        super()
        this.state = {
            firstName: '',
            lastName: '',
            email: '',
            gender: '',
            username: '',
            password: '',
            confirmPassword: ''

        }

        this.onChange = this.onChange.bind(this);
        this.onSubmit = this.onSubmit.bind(this);
    }



    render(){
        return(
            <div></div>
        )
    }
}


export default Register;
